	/* Election2012
	/*-----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------*/
	if(ISCJS.gi("election2012Nav")) {
		ISCJS.cl("Running Election 2012 JS, election2012Nav found");
		var cura=ISCJS.getAnchorValue('t');
		var aruc='',ah=5000;
		if(cura==''||typeof cura != 'string') cura='del_tracker';
		if(cura=='del_tracker'){aruc='e0'+cura;ah=1900;}
		else if(cura=='camp_finance'){aruc='e1'+cura;ah=800;}
		else if(cura=='race_run'){aruc='e2'+cura;ah=5000;}
		else if(cura=='election_adwatch'){aruc='e3'+cura;ah=2500;}
		else if(cura=='candidate_track'){aruc='e4'+cura;ah=1500;}
		
		$("#e0del_tracker, #e1camp_finance, #e2race_run, #e3election_adwatch, #e4candidate_track").removeClass("e2012s");
		$("#"+aruc).addClass("e2012s");
		$("#e0if, #e1if, #e2if, #e3if, #e4if").hide();
		$("#e"+aruc.charAt(1)*1+"if").attr("style","min-height:500px").attr("height",ah);
		
		$('#election2012Nav li').click(function(){
			var curr=$(this).attr("id");
			var n=curr.charAt(1)*1;
			var src=$("#e"+n+"if").attr("src");
			var ahh=0;
			if(n==0){ahh=1900;}
			else if(n==1){ahh=800;}
			else if(n==2){ahh=5000;}
			else if(n==3){ahh=2500;}
			else if(n==4){ahh=1500;}
	
			$("#e0del_tracker, #e1camp_finance, #e2race_run, #e3election_adwatch, #e4candidate_track").removeClass("e2012s");
			$(this).addClass("e2012s");
			$("#e0if, #e1if, #e2if, #e3if, #e4if").hide();
			
			$("#e"+n+"if").attr("style","min-height:500px").attr("height",ahh).attr("src",src);
			return false;
		});
	}
	
	
	
		
